import * as api from '../api'

export const signup = (authData,) => async(dispatch) => {
    try {
        const { data } = await api.signUp(authData)
        dispatch({ type :'AUTH',data})
        navigate('/')
    } catch (error) {
        console.log(error)
    }
}

export const login = (authData,history) => async(dispatch) => {
    try {
        const { data } = await api.signUp(authData)
        dispatch({ type :'AUTH',data})
        navigate('/')
    } catch (error) {
        console.log(error)
    }
}
